import React from 'react'

const Item = () =>{
    const firstName = 'Naveen'
    const lastName = 'Kumar'
    return (
                <div className="list">
                <input type ='checkbox' />Hello<br />
                <input type ='checkbox' />{`Hi ${firstName} ${lastName}` }<br />
                <input type ='checkbox' />Hey<br />
                </div>
    )
}

export default Item;
